import React from 'react';
import ReactFlow, { 
    Handle, MiniMap,
  Controls, 
} from 'react-flow-renderer';


const upload = [
  {
    id: '1',
    type: 'upload',
    position: { x: 200, y: 200 },
    data: { text: 'Upload' },
  },
];

const dischargeRecord = [
  {
    id: '2',
    type: 'extract',
    position: { x: 300, y: 100 },
    data: { text: 'Discharge Record' },
  },
];

const identityCard = [
  {
    id: '3',
    type: 'extract',
    position: { x: 300, y: 300 },
    data: { text: 'Identity Card' },
  },
];


const uploadStyle = {
  background: '#9CA8B3',
  color: '#FFF',
  padding: 30,
};

const UploadComponent = ({ data }) => {
  return (
    <div style={uploadStyle}>
      <div>{data.text}</div>
      <Handle
        type="source"
        position="right"
        id="1"
        style={{ top: '70%', borderRadius: 0 }}
      />
    </div>
  );
};



const nodeTypes = {
  upload: UploadComponent,
};


const App = () => {
  return (
    <div style={{ height: 700 }}>
      <ReactFlow elements={upload} nodeTypes={nodeTypes}>
        <MiniMap />
        <Controls />
      </ReactFlow>
    </div>
  );
};

export default App;
